function nav() {


    const enabled = "false";

    function isAccountEnabled(){
        enabled = window.localStorage.getItem("name");
        if(enabled == null){
            return "/myAccount";
        } else {
            return "#0";
        }
    }
    function isAccountClassEnabled(classEnabled){
            enabled = window.localStorage.getItem("name");
            if(classEnabled == ""){
                return "isDisabled";
            } else {
                return "";
            }
        }


    return (
        <div className = "nav">
            <ul className = "nav-ul">
                <li>
                    <a href="/home">home</a>      
                </li>
                <li>
                    <a href="/calanderView">Calander view</a>
                </li>
                <li>
                    <a class = {isAccountClassEnabled("false")} href={isAccountEnabled("false")}>my account</a>
                </li>
                <li>
                    <a class = "isDisabled">log out</a>
                </li>
            </ul>
        </div>

    )
}

export default nav
